INSERT INTO `ip_quotes` (`quote_id`, `invoice_id`, `user_id`, `client_id`, `invoice_group_id`, `quote_status_id`, `quote_date_created`, `quote_date_modified`, `quote_date_expires`, `quote_number`, `quote_discount_amount`, `quote_discount_percent`, `quote_url_key`, `quote_password`, `notes`) VALUES
(2, 0, 1, 3, 4, 4, '2019-02-22', '2019-02-27 12:29:46', '2019-03-09', 'Quote:MDPL/DL/8623/2019', 0.00, 0.00, 'quiyls3N9Gc0FdYrSwIBg45tD8VJ6enR', '', 'Specifications as shared in the mail dt. 10-Jan-2019.\nGEOMET coating Grey Color instead of Zinc Nickel Plating.\nGeneral Terms and conditions.\n1. Delivery  Ex-our works.\n2. Packing- sea worthy packing\n3. Sample 25 nos will be supplied within 6 Weeks from the date of purchase order.\n4. Payment Terms\nTooling - 100% along with Purchase Order\nSupply of Parts - 30 days from date of Invoice\n5. Supply of parts will be 500 nos per month. We can increase the quantity if required.\n6. Forging Tool is good for up to 15000nos. After that a new tool needs to be made.\n7. Quote is valid for 45 days.'),
(3, 0, 1, 23, 4, 2, '2019-02-22', '2019-02-27 08:20:56', '2019-03-09', 'Quote:MDPL/AACHI/8624/2019', 0.00, 0.00, '1hLAiT2N0CVHgBoZXYJS7rtzaMwnkFQ4', '', '1. All prices are in INR. Price quoted is Ex-our works. Taxes,Duties and any other levys will be charged extra. Cost quoted includes Packing & forwarding. At present GST will be 18%\n2. Delivery:- 4 WEEKS required from the date of purchase order\n3. Payment:- 50% advance along with the order, 50% against installation at the site .\n4. Guarantee:- System supplied will be guaranteed for a period of One year from the date of supply for any defects in manufacturing. The life of the display system will be minimum 3-4 years with proper maintenance of the system under CAMC. CAMC charges at 15% of the cost of the equipment after completing the 1 year warranty .\n5. Order once placed cannot be canceled since it is being custom built and manufactured for your specific purpose.\n6. Necessary insurance for the equipment if any needed to be provided or arranged for by the buyer. Our responsibility for safe keeping and delivery is limited to Ex-Works dispatch .'),
(4, 0, 1, 5, 4, 3, '2019-02-23', '2019-02-27 08:20:36', '2019-03-10', 'Quote:MDPL/FMC/8626/2019', 0.00, 0.00, '6VeLGAFzcwP0Mfq95tUmSYDi4QouCklO', '', '1. All prices are in USD. Price quoted is Ex-our works. \n2. Delivery:- 6-8 WEEKS required from the date of purchase order\n3. Payment:- 45 days from date of Invoice.\n5. Order once placed cannot be canceled since it is being custom manufactured for your specific purpose.\n'),
(5, 0, 1, 24, 4, 3, '2019-03-20', '2019-03-20 07:13:40', '2019-03-14', 'PO:MDPL/CRFFG/8633-A/2019', 0.00, 0.00, 'DFVmuPKYhbn9jE6Udi8oCXc0IwyO7RSA', '', '1. Tool Development and Sample Submission - 2 weeks\n2. Rs.1,00,000 Advance will be paid for Tooling(Bank of Maharashtra Chq No:080978 dt: 27-Feb-2019), balance payable on Sample submission\n3. 40 nos Sample to be forged.\n4. Reference drawings as shared on mail dt. 23-Jan-2019\n5. GST at 18% extra'),
(6, 0, 1, 32, 4, 4, '2019-03-06', '2019-03-13 17:25:34', '2019-03-21', 'Quote:MDPL/CHET/8628/2019', 0.00, 0.00, '8wQ6JHVfPeBU0CNI3vcsG5YxS2MELo94', '', '1. Price quoted is Ex-our works. Taxes,Duties and any other levys will be charged extra. Cost quoted includes Packing & forwarding. At present GST will be 18%\n2. Delivery:- minimum 12-16 WEEKS required from the date of purchase order\n3. Payment:- 50% advance along with the order and the balance 50% to be paid after installation and commissioning of the system on pro-rata basis on completion on individual Job completions.\n4. Guarantee:- System supplied will be guaranteed for a period of 1year from the date of supply for any defects inmanufacturing. The life of the display system will be minimum 4-5 years with proper maintenance of the Board under CAMC applicable at 15%per year of initial hardware cost. .\n5. Temporary Power supply of minimum 5 kva for welding during structural fabrication and a permanent power of 3000 watts capacity, Three phase to be provided free of cost within 5 meters from the Display Board location ,properly terminated in power junction box with safety cutouts.\n6. Necessary permission if any required for installing and operating the Board is to be obtained by the purchaser from Government and other local Administrative body. Our scope is limited to providing the display hardware and installation at site and the associated services to operate the display.\n7. Order once placed cannot be canceled since it is being custom built and manufactured for your specific purpose.'),
(7, 0, 1, 33, 4, 1, '2019-04-05', '2019-04-05 06:38:34', '2019-04-20', 'Quote:MDPL/OASYS/8673/2019', 0.00, 0.00, 'o5tFZ9qWid0OxcaN3B7VEuGn1rKfTYem', '', '1. Price quoted is in INR and Ex-our works. Taxes, Duties and any other levys will be charged extra. Cost quoted includes Packing & forwarding. At present GST will be 18%\n2. Delivery:- minimum 6 WEEKS required from the date of purchase order\n3. Payment:- 50% advance along with the order and the balance 50% to be paid after installation and\ncommissioning of the system on pro-rata basis on individual Job completions.\n4. Guarantee:- System supplied will be guaranteed for a period of 1 year from the date of supply for any defects in manufacturing. The life of the GPS trackers will be minimum 4-5 years with proper maintenance of the hardware under CAMC applicable at 12.5%per year of initial hardware cost. .\n5. Necessary permission if any required for installing and operating the GPS devices is to be obtained by the purchaser from Government and other local Administrative body. Our scope is limited to providing the hardware and installation at site and the associated services to operate the GPS devices.\n7. Order once placed cannot be canceled since it is being custom built and manufactured for your specific purpose.\n8. This offer is valid till 31-May-2019.\n\n\n\n\n\nAnnexure - A\n\nTracking Server\n* GIS Based Fleet Management, Monitoring and Control System\n* Bus & Driver Behavior Monitoring & Reports\n* Fuel Rod Sensor(Capacitive/Resistance Type )\n* Route Deviation Alert & Reports\n* Delayed Trip Reports\n* Speed Management\n* Fuel Monitoring with consumption/pilferage/theft/mileage\n* Bus Stand Entry & Exit Management(using RFID, Geo Fencing etc. latest technologies to cater to\nHRTC requirement)\n* Various MIS Reports\n         - Passengers travelling in a bus at a given point of time\n         - Distance travelled Report\n         - Stoppage Analysis\n         - Live Status of Vehicle (vehicle-wise, depot-wise etc)\n         - Speed Analysis, over Speed Analysis, over Stoppage Analysis\n         - Ignition Analysis, Idling Analysis, Over Idling Report\n         - Route traversed Report\n         - Trip Report\n         - SMS and Notification Report\n         - Entry, Exit report\n         - Daily Report\n         - Other Reports (Manage Vehicles, Service Reminder, other report(s) required from time to time during the currency of contract)'),
(8, 0, 2, 24, 4, 4, '2019-05-06', '2019-06-12 03:35:00', '2019-05-06', 'PO/MDPL/CRFG/8694/2019', 0.00, 0.00, 'QRkLh7Y9x4pEMGstDSuJ1P2j3AcgbTaC', '', '1. Reference drawings as shared on 30-Apr-2019\n2. GST at 18% extra\n3. Delivery Immediate.'),
(9, 0, 1, 24, 4, 1, '2019-05-29', '2019-06-12 04:16:46', '2019-06-27', 'PO/MDPL/CRFG/8716/2019', 0.00, 0.00, 'N4d8mDtBJRhTG67rbUEVi9n05FlyLQYZ', '', ''),
(10, 0, 1, 3, 4, 1, '2019-09-03', '2019-09-03 14:23:48', '2019-10-03', 'Quote:MDPL/DL/8769/2019', 0.00, 0.00, 'SM6wC1pxQgkA7uGlvFiLfjbTcns5yUmO', '', 'Specifications as shared in the mails dt. 20-Aug-2019, 21-Aug-2019, 22-Aug-2019.\nGeneral Terms and conditions.\n1. Delivery  Ex-our works.\n2. Packing- sea worthy packing\n3. Initial Order 150 nos will be supplied within 8 Weeks from the date of purchase order.\n4. Payment Terms\n---Tooling - 100% along with Purchase Order\n---Supply of Parts - 45 days from date of Invoice\n5. Supply of parts will be 100 nos per month. We can increase the quantity if required.\n6. Forging Tool is good for up to 5000nos. After that a new tool needs to be made.\n7. Quote is valid for 45 days.'),
(11, 0, 1, 3, 4, 1, '2020-03-30', '2020-03-30 11:46:06', '2020-04-30', 'MDPL/DL/9000/2020', 0.00, 0.00, 'kIvRZoaGlJTemd4M2pg6S8bLxWqQ5CUO', '', 'Specifications as per Drawings attached with Email dt. 10-Mar-2020.\nGeneral Terms and conditions.\n1. Delivery  Ex-our works.\n2. Packing- Sea/Air worthy packing\n3. Initial Order 10 nos will be supplied within 8 Weeks from the date of purchase order.\n4. Payment Terms - 45 days from date of Invoice\n5. Supply of parts will be 10 sets per month. We can increase the quantity if required.\n7. Quote is valid for 45 days.'),
